import Header from '../Header/Header'
import Model from './Model/Model'
import Location from './Location/Location'
import NavbarOrder from './NavbarOrder/NavbarOrder'
import Description from './Description/Description';
import { BrowserRouter, Route } from 'react-router-dom';

const OrderPage = () => {

  let upd;
  // const [location1, setStateLocation1] = React.useState({})
  let updateData = (value1,value2) => {
    // setStateLocation1({value1, value2})
    upd = {value1, value2};
    {console.log(upd)}
    return upd;
  }
  // console.log(upd)
  // let location1 = upd;

  return (
    <div className={ob.content}>
      <Header />
      <div></div>
      <NavbarOrder />
      <div className={ob.body}>
        <div className={ob.body_content}>
          <Route exact path='/carsharing/orderpage/location'>
            <Location updateData={updateData} />
          </Route>
          {/* {console.log(upd)} */}
          <Route exact path='/carsharing/orderpage/model' component={Model} />
          <Description
            location={updateData}
            // location1={location1}
          />
        </div>
      </div>
    </div>
  )
}

export default OrderPage;
